import { Link } from "react-router-dom";

const Navbar = (props) => {
  return (
    <nav className="navbar" style={{back}}>
      <Link to="/">
        <h1>
          <i className={props.logo}></i>
          {props.appName}
        </h1>
      </Link>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
      </ul>
    </nav>
  );
};
export default Navbar;
